@Component({
  selector: 'app-tabcompoment',
  templateUrl: './tabcompoment.component.html',
  styleUrls: ['./tabcompoment.component.scss']
})
export class TabcompomentComponent {
  @Input() tabArray : string[]=[];
  heading : string = "Example Heading";

}
